INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118061, 2834, "青空の下で謁見", 7, 40, "ペコリーヌとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 2, 0, 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118062, 2835, "未来の騎空団\nマスコット？", 7, 40, "マホとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 2, 0, 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118063, 2837, "お嬢さまからの\n緊急依頼", 7, 40, "アキノとの出会い", 10118, "ランドソル市街地", 91002, 8, 0, 2, 0, 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118064, 4108402, "黄金色の悩みごと", 18, 40, "ジュンとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 2, 0, 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118065, 4107402, "白熱！　格闘大会！", 18, 40, "カオリとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 2, 0, 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118066, 9000227, "祭り太鼓はオーエドの華", 16, 40, "ニノンとの出会い", 10118, "オーエド町", 91002, 8, 1, 2, 0, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118067, 2101181, "人気者は遅れて\nやってくる", 19, 40, "スズナとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 3, 0, 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118068, 4109402, "巫女・ミーツ・魔法少女", 18, 40, "ナナカとの出会い", 10118, "ランドソル市街地", 91002, 8, 0, 3, 0, 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118069, 4305402, "ネズ耳は二度なくなる", 18, 40, "キャル＆コッコロとの出会い", 10118, "フリーマーケット会場", 91002, 8, 0, 3, 0, 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118070, 4101402, "この出会いにカンパイ！", 18, 40, "ユカリとの出会い", 10118, "ランドソル市街地", 91002, 8, 0, 3, 0, 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118071, 4106402, "陰陽アンサンブル", 18, 40, "アオイとの出会い", 10118, "ランドソル市街地", 91002, 8, 0, 3, 0, 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118072, 2836, "運試し十番勝負！", 7, 40, "シノブとの出会い", 10118, "フリーマーケット会場", 91002, 8, 1, 3, 0, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (5118600, 0, "彼女たちの新たな日常", 0, 0, "オープニング", 10118, 0, 0, 0, 0, 1, 10145115, 0, 0);
